-- ----------------------------
--  Table structure for `seckill_products`
-- ----------------------------
DROP TABLE IF EXISTS `seckill_products`;
CREATE TABLE `seckill_products` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `product_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商品ID',
  `start_at` datetime NOT NULL COMMENT '秒杀开始时间',
  `end_at` datetime NOT NULL COMMENT '秒杀结束时间',
  PRIMARY KEY (`id`),
  KEY `seckill_products_product_id_index` (`product_id`),
  CONSTRAINT `seckill_products_product_id_foreign` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='秒杀商品表';

